import React from 'react'
import './Navbar.css'
import logout from '../../assets/logout.png'

const Navbar = () => {

    function reloadPage() {
        window.location.reload();
    }

  return (
    <div className='nav'>
        <div className="nav-logo" onClick={reloadPage}>G | K </div>
        <div className='list'>Document Management</div>
        <div className='login'><p >Login </p><img src={logout} alt="" /></div>

    </div>
  )
}

export default Navbar
